const _ = require('lodash');
const cancelSale = require('./cancelSale');

const cancelSales = ({
    sales,
}) => {
    return _(sales)
        .map(sale => cancelSale({
            accountName: sale.seller,
            saleId: sale.id,
        }))
        .flatten()
        .value();
};

module.exports = cancelSales;
